import React from 'react';
import startCareerEasyBlock from "./startCareerEasyBlock";

export default function Landing() {
    return(

        <React.Fragment>
            <startCareerEasyBlock/>
            <div className="row">

                <p className="main-landing-block-text">Кар'єрні можливості від найкращих компаній</p>

            </div>
        </React.Fragment>

    )
}
